sources.styles/utils/mixins.scss:
@mixin onTablet {
  @media (min-width: $tablet-min-width) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: $desktop-min-width) {
    @content;
  }
}

@mixin pageGrid {
  --columns: 2;
  display: grid;
  column-gap: 20px;
  grid-template-columns: repeat(var(--columns), 1fr);

  @include onTablet {
    column-gap: 24px;
    --columns: 6;
  }
  @include onDesktop {
    --columns: 12;
  }
}

@mixin hover($property,$toValue) {
  transition: #{$property} $effectDuration ease-out;
  &:hover {
    #{$property}: $toValue;
  }

}

@mixin iconPhoneSize() {
  @include onDesktop() {
    background-image: url(../images/icon/icon-phone-hover.svg);
    width: 190px;
  }
}

