sources.styles/blocks/contacts.scss:
.contacts {

  &__content {
    @include pageGrid;
  }

  &__form {
    grid-column: span 2;
    margin-bottom: 48px;

    @include onTablet {
      grid-column: span 3;
    }

    @include onDesktop {
      grid-column: span 5;
    }

    &__field {
      box-sizing: border-box;
      border: none;
      border-radius: 16px;
      width: 100%;
      padding-inline: 14px;
      background-color: $main-text-color;
      color: $input-color;
      font-size: 14px;
      font-weight: 400;
      outline: none;

      &::placeholder {
        color: $input-color;
      }

      &:hover::placeholder {
        color: $placeholder-color;
      }

      &:focus {
        color: $placeholder-color;
      }

      &--input {
        margin-bottom: 16px;
        height: 48px;
      }

      &--textArea {
        height: 148px;
        margin-bottom: 32px;
        padding: 14px 16px;

        &::placeholder {
          font-family: Poppins, Arial, sans-serif;
          font-weight: 400;
        }
      }
    }
  }

  &-info {
    grid-column: 1 / -1;

    @include onTablet {
      grid-column: span 3;
    }

    @include onDesktop {
      grid-column: 8 / -1;
    }

    &__header {
      margin-bottom: 8px;
      font-size: 14px;
      font-weight: 400;
      color: $main-text-color ;
    }

    &__value {
      margin-bottom: 24px;
      color: $main-text-color;
      cursor: pointer;
      &:hover {
        color: gray;
      }
    }

    &__phone {
      text-decoration: none;
      color: $main-text-color;
    }

    &__email {
      text-decoration: none;
      color: $main-text-color;
    }

    &__address {
      text-decoration: none;
      color: $main-text-color;
    }
  }
}

